import React, { Component } from 'react';
import { GoogleApiWrapper, InfoWindow, Map, Marker } from 'google-maps-react';
import '../styles/Map.css';
import MarkerInfo from "./MarkerInfo";


class Mapper extends Component {

  static defaultProps = {
    center: {
      lat: 59.95,
      lng: 30.33
    },
    zoom: 11
  };


  render() {
    return (

        <Map
        defaultZoom={13}
        defaultCenter={new google.maps.LatLng(42.357064, -71.062577)}>

        <MarkerInfo position={{ lat: 42.3381437, lng: -71.0475773 }} content="South Boston" />
        <MarkerInfo position={{ lat: 42.3875968, lng: -71.0994968 }} content="Somervil" />

    </Map>
    );
  }
};


export default GoogleApiWrapper({
    api: ("AIzaSyAEW46KVttk6w0Ik_-hKNl7XqQ31t07q0U")
}) (Mapper);
